var imgData = "data:image/png;base64,"
//-----------------

var canvas = document.createElement('canvas');
	canvas.width = 900;
  canvas.height = 600;
  document.body.appendChild(canvas);
var ctx = canvas.getContext('2d');

var loadedImageCount = 0;

var img = new Image();
var emergeLogo = document.getElementById('emerge-logo');
var bbLogo = document.getElementById('bb-logo');

img.onload = onImageLoad;
emergeLogo.onload = onImageLoad;
bbLogo.onload = onImageLoad;

function onImageLoad() {
	loadedImageCount++;
	renderImage();
	console.log(loadedImageCount);
}

function renderImage() {
	// wait until all three images are loaded
	if (loadedImageCount == 3) {

		ctx.drawImage( img, 0, 0, canvas.width, canvas.height );
	
		var logoSize = 75;
		var logoMargin = 25;
		
		ctx.drawImage(emergeLogo, 
					  logoMargin * 2, // account for printer not being margin accurate
					  logoMargin * 1.5, // ...
					  logoSize, 
					  logoSize);

		ctx.drawImage(bbLogo, 
					  logoMargin * 2 + logoSize + logoMargin, 
					  logoMargin * 1.5, 
					  logoSize, 
					  logoSize);

		var url = "emerge.brangerbriz.com/EyBKv";
		var fontSize = 42;
		ctx.font = fontSize + "px Arial";
		ctx.textBaseline = "middle";
		ctx.textAlign = "end";
		var textWidth = ctx.measureText(url).width;

		ctx.fillStyle = "#1E202F";
		var rectMargin = 5; // double this val on the left and right
		ctx.fillRect(canvas.width - logoMargin * 2 - textWidth - rectMargin * 2, 
				     canvas.height - 60 - fontSize/2 - rectMargin,
				     textWidth + rectMargin * 4,
				     fontSize + rectMargin * 2);

		ctx.fillStyle = "#fff";
		ctx.fillText(url, canvas.width - logoMargin * 2, canvas.height - 60);
	}

	var print = document.createElement("img");
	print.src = canvas.toDataURL("image/jpeg");
	print.onload = function() {
		document.body.appendChild(print);
	}
}

img.src = imgData;
img.crossOrigin = 'anonymous';


